import { useEffect } from 'react';
import axios from 'axios';
import './App.css';
import ExtentionCard from './components/extentions/extentionCard/ExtentionCard';
import ExtentionList from './components/extentions/extentionList/ExtentionList';
import Navbar from './components/layout/navbar/Navbar';
import { LuChartNoAxesColumnIncreasing } from 'react-icons/lu';

function App() {
  useEffect(()=>{
   axios.get('http://localhost:5000/') 
   .then()
  },[])
  return (
    <div >
      <Navbar/>
      <ExtentionList/>
      <div className='extentionCards'>

      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>
      <ExtentionCard/>

      </div>

    </div>
  );
}

export default App;
